import { View, Text } from 'react-native'
import React from 'react'

const MyHunts = () => {
  return (
    <View>
      <StandardButton 
          title='Active Hunt'
          onPress={() => {
            navigation.navigate('ActiveHunt')
          }}
        />
    </View>
  )
}

export default MyHunts
